import React from "react";
import data from "../data/data";

export const Hero = () => {
  const { results } = data;
  const a = results[0].backdrop_path;
  return (
    <section className="w-full lg:h-20">
      <div className="w-full">
        <img
          className="w-full"
          src={`https://image.tmdb.org/t/p/original${a}`}
          alt="img"
        />
      </div>
    </section>
  );
};

export default Hero;
